import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import org.springframework.web.bind.WebDataBinder;

import java.util.HashMap;
import java.util.Map;
import java.util.Optional;

import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.ArgumentMatchers.*;
import static org.mockito.Mockito.*;

@ExtendWith(MockitoExtension.class)
class VisitControllerTest {

	@Mock
	private OwnerRepository owners;

	@Mock
	private Pet pet;

	@Mock
	private Owner owner;

	@InjectMocks
	private VisitController controller;

	// =========================================================================
	// Tests for setAllowedFields(WebDataBinder dataBinder)
	// =========================================================================

	@Test
	@DisplayName("setAllowedFields should initialize data binder with allowed fields")
	void setAllowedFields_withValidBinder_callsSetAllowedFields() {
		WebDataBinder dataBinder = mock(WebDataBinder.class);

		controller.setAllowedFields(dataBinder);

		verify(dataBinder).setDisallowedFields("id");
	}

	// =========================================================================
	// Tests for Visit loadPetWithVisit(int ownerId, int petId, Map<String, Object> model)
	// =========================================================================

	@Test
	@DisplayName("loadPetWithVisit should return visit when owner and pet exist")
	void loadPetWithVisit_withValidIds_returnsVisit() {
		Map<String, Object> model = new HashMap<>();

		when(owners.findById(1)).thenReturn(Optional.of(owner));
		when(owner.getPet(1)).thenReturn(pet);

		Visit result = controller.loadPetWithVisit(1, 1, model);

		assertNotNull(result);
		verify(owners).findById(1);
		verify(owner).getPet(1);
	}

	@Test
	@DisplayName("loadPetWithVisit should throw exception when owner not found")
	void loadPetWithVisit_withInvalidOwnerId_throwsException() {
		Map<String, Object> model = new HashMap<>();

		when(owners.findById(999)).thenReturn(Optional.empty());

		IllegalArgumentException exception = assertThrows(IllegalArgumentException.class,
				() -> controller.loadPetWithVisit(999, 1, model));

		assertTrue(exception.getMessage().contains("not found") || exception.getMessage().contains("999"));
	}

}
